import { Box, Grid, Stack, Typography } from '@mui/material';
import Selected from '../../../selected/Selected';

function Other() {
  return (
    <Box>
      <Box component="form">
        <Stack
          component="form"
          direction="column"
          spacing={2}
          sx={{
            paddingLeft: '20px',
            paddingRight: '20px',
            paddingBottom: '20px',
            gap: '10px',
            display: 'flex',
            maxWidth: '400px',
            width: '100%',
          }}
        >
          <Grid
            container
            spacing={'row'}
            sx={{ '&:first-of-type': { marginLeft: '0', marginTop: 0 }, marginTop: '0 !important' }}
          >
            <Grid
              item
              xs={4}
              sx={{
                paddingLeft: '0 !important',
                paddingTop: '0 !important',
                display: 'flex',
                alignItems: 'center',
                marginTop: '0 !important',
              }}
            >
              <Typography
                variant="body2"
                gutterBottom
                sx={{
                  fontFamily: 'SVN-Sofia-Regular',
                  display: 'flex',
                  alignItems: 'center',
                  margin: 0,
                  fontSize: '16px',
                }}
              >
                Date Start
                <Box component="span" sx={{ color: 'rgb(229, 72, 77)', margin: 0 }}>
                  *
                </Box>
              </Typography>
            </Grid>
            <Grid item xs={8} sx={{ paddingLeft: '0 !important', paddingTop: '0 !important' }}></Grid>
          </Grid>
          <Grid
            container
            spacing={'row'}
            sx={{ '&:first-of-type': { marginLeft: '0', marginTop: 0 }, marginTop: '0 !important' }}
          >
            <Grid
              item
              xs={4}
              sx={{
                paddingLeft: '0 !important',
                paddingTop: '0 !important',
                display: 'flex',
                alignItems: 'center',
                marginTop: '0 !important',
              }}
            >
              <Typography
                variant="body2"
                gutterBottom
                sx={{
                  fontFamily: 'SVN-Sofia-Regular',
                  display: 'flex',
                  alignItems: 'center',
                  margin: 0,
                  fontSize: '16px',
                }}
              >
                Employee Type
                <Box component="span" sx={{ color: 'rgb(229, 72, 77)', margin: 0 }}>
                  *
                </Box>
              </Typography>
            </Grid>
            <Grid item xs={8} sx={{ paddingLeft: '0 !important', paddingTop: '0 !important' }}>
              <Selected defaultOption="Choose Type" objectOption={['Permanent', 'Part-time', 'Contract']} />
            </Grid>
          </Grid>
        </Stack>
      </Box>
    </Box>
  );
}

export default Other;
